import React from 'react';
import Style from './Footer.module.css';

const Footer = () => {
    return (
        <div className={Style.container}>
            <p>Artvelde Hogeschool</p>
            <p>2023</p>
            <p>Ruveyda Kartal</p>
        </div>
    );
};

export default Footer;
